const HeaderNavBar = (props) => {
      const { handleText, handleAction } = props;

      const selectButton = () => {
            const goToLogin = '/login';

            switch (handleText) {
                  case 'Logout':
                        return;
                        <button
                              bsStyle='primary'
                              className=' mr-sm-2'
                              onClick={handleAction}
                        >
                              {handleText}
                        </button>;
                  case 'Admin':
                        return;
                        <button
                              href={goToLogin}
                              bsStyle='primary'
                              className=' mr-sm-2'
                        >
                              {handleText}
                        </button>;
                  default:
                        return null;
            }
      };

      return (
            <nav>
                  <div className='brandFont'>
                        <a href='/'>Music-Map</a>
                  </div>

                  <div>{selectButton()}</div>
            </nav>
      );
};

export default HeaderNavBar;
